DROP TABLE IF EXISTS `publish`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `publish` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `published_by` bigint(20) unsigned NOT NULL,
  `published_at` datetime DEFAULT current_timestamp(),
  `text_content` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `media_content_id` bigint(20) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `published_by` (`published_by`),
  KEY `fk_media_id` (`media_content_id`),
  CONSTRAINT `fk_media_id` FOREIGN KEY (`media_content_id`) REFERENCES `media` (`id`),
  CONSTRAINT `fk_user_id` FOREIGN KEY (`published_by`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
